import React from "react";
import { UilUserPlus } from "@iconscout/react-unicons";

const Home = () => {
  return (
    <div className="home-container">
      <div className="home-top-section">
        <h1>Hi, Andrew</h1>
        <div className="item-application-box">
          <UilUserPlus />
        </div>
        <p>Item Application</p>
      </div>
    </div>
  );
};

export default Home;
